import * as React from "react";

import { Table } from "react-bootstrap";
import Form from "react-bootstrap/Form";
import { useAppState } from "../../../service/AppStateContext.tsx";
import BaseService from "../../../service/base.service.tsx";
import {Tables} from "../models/table";
import { useState, useEffect } from "react";
import Button from "react-bootstrap/Button";
import { Link/*, useRouteMatch*/ } from "react-router-dom";
// import { TablesNavbar } from "./navbarFinance";

const TablesView = (props) => {
  const [error, setError] = useState(null);
  const [isLoaded, setIsLoaded] = useState(false);
  const [finance, setTables] = useState({}, Tables);


  const path = window.location.pathname;
  const splited = path.split("/");
  const x = splited[splited.length-1]
  console.log("qqqqqqq", x)
  const { state, dispatch } = useAppState();
//   const buildingId = state.buildingId;

    //   let { path, url } = useRouteMatch();



//   const setTablesId = (id: string) => {
//     financeId = id;
//   };

  useEffect(() => {
    console.group("ssss", state);
    if (financeId) {
      BaseService.fetch(`/tables/${x}`).then(
        (response) => {
          setIsLoaded(true);
          setTables(response.data, Tables);
          console.log("response.data", response.data);
          console.log("finance Daqta", finance);
          console.groupEnd();
        },
        (error) => {
          setIsLoaded(true);
          setError(error);
        }
      );
    }
  }, [state]);

  console.log("---props", props, state);

  return (
    <>
      <div className="row">
        <div className="col">
          <h4>פיננסי</h4>
        </div>
        {finance && (
          <div className="col">
            <h5>-{finance.id}-</h5>
          </div>
        )}
      </div>

      {/* <TablesNavbar></TablesNavbar> */}
      <Link to={`/edit`}>
        <Button variant="primary" title="edit">
          <i className="bi-pencil-fill"></i>
          <span>עריכת פרטי חשבון</span>
        </Button>
      </Link>

      {
        <Table striped bordered hover>
          <tbody>
            <tr>
              <td>id</td>
              <td>{finance.id}</td>
            </tr>
            <tr>
              <td>סוג חשבון</td>
              <td>{finance.accountType}</td>
            </tr>
            <tr>
              <td>שם חשבון</td>
              <td>{finance.accountName}</td>
            </tr>
            <tr>
              <td>שם הבנק</td>
              <td>{finance.bankName}</td>
            </tr>
            <tr>
              <td>מספר סניף</td>
              <td>{finance.bankBranch}</td>
            </tr>
            <tr>
              <td>מספר חשבון בנק</td>
              <td>{finance.bankAccountNumber}</td>
            </tr>
            <tr>
              <td>הערות</td>
              <td>{finance.comments}</td>
            </tr>
            <tr>
              <td>Is active</td>
              <td>
                <Form.Check
                  type="checkbox"
                  name="isActive"
                  checked={finance.isActive}
                  disabled
                />
              </td>
            </tr>
            <tr>
              <td>הערות</td>
              <td>{finance.comments}</td>
            </tr>
          </tbody>
        </Table>
      }
    </>
  );
};
export default TablesView;
